import React from 'react';
import {View, Text, Button} from 'react-native'

export default function Profile(props) {
  return (
    <View>
      <Text>Hi, {props.route.params.username} </Text>
      <Button title="Back to home" onpress={() => props.navigation.navigate("Home", props.route.params)}></Button>
    </View>
  )
}
